import React, { useState } from "react";
import productseparation from "../images/produceseparation.png";
import vegetablesflying from "../images2/vegetablesflying.jpeg";
function Main(props) {
  return (
    <>
      <img src={vegetablesflying} />
      <h1>Insert product here</h1>
      <input name="product" type="text" />
      <h1>Product type</h1>
      <input type="text" />
      <h1>Best before date</h1>
      <input type="date" />
      <h1>Use by date</h1>
      <input type="date" />

      <button>Add Product</button>
      <button>Remove Product</button>
      <img src={productseparation} />
    </>
  );
}

export default Main;
